import { useState, useEffect } from "react";
import axios from "axios";
import AccountCircle from "@mui/icons-material/AccountCircle";
import AlternateEmailIcon from "@mui/icons-material/AlternateEmail";
import LockIcon from "@mui/icons-material/Lock";
import LockOpenIcon from "@mui/icons-material/LockOpen";
import "../style/Cadastro.css";
import "../style/CadastroCliente.css";
import CameraAltIcon from "@mui/icons-material/CameraAlt";
import InputCamera from "./InputCamera";
import InputAdornment from "@mui/material/InputAdornment";
import validarSenhaForca from "./validation/validation";

const InputsIcon = () => {
  const [userCuidador, setUserCuidador] = useState({
    nome: "",
    sobrenome: "",
    email: "",
    senha: "",
    dataNascimento: "",
    cpf: "",
    foto: "",
    biografia: "",
    possuiAnimais: 1,
    possuiCriancas: 1,
    preferencias: "",
    moradia: "",
    limitacoes: "",
    avaliacao: 1,
    idSexoHost: 1,
  });

  console.log(userCuidador);
  const handleUserCuidadorSubmit = (userCuidador) => {
    axios.defaults.headers.post["Content-Type"] =
      "application/json;charset=utf-8";
    axios.defaults.headers.post["Access-Control-Allow-Origin"] = "*";
    axios
      .post("http://localhost/Cuidador/Cuidador/api/cuidador", userCuidador)
      .then((res) => console.log(res.data));
  };
  const listElements = () => {
    axios
      .get("http://localhost/Cuidador/Cuidador/api/cuidador")
      .then((res) => console.log(res.data));
  };
  useEffect(() => {
    listElements();
  }, []);

  function testeClick() {
    console.log("ola");
  }

  testeClick();

  return (
    <>
      <form onSubmit={() => handleUserCuidadorSubmit(userCuidador)}>
        <div id="teste">
          <div id="containerInput">
            <div id="containerBorderImage">
              <input
                type="file"
                name="inputImage"
                className="inputImage"
                id="foto"
                value={userCuidador.foto}
                onChange={(e) =>
                  setUserCuidador({ ...userCuidador, foto: e.target.value })
                }
              />
              <CameraAltIcon id="iconInputCamera" />
            </div>
          </div>
          <div id="contInputsPet">
            {/* <AccountCircle id="iconInputLabel" /> */}
            <input
              id="nome"
              className="containerInputNome"
              placeholder="Nome"
              value={userCuidador.nome}
              onChange={(e) =>
                setUserCuidador({ ...userCuidador, nome: e.target.value })
              }
            />
            {/* <AccountCircle id="iconInputLabel" /> */}
            <input
              label="Sobrenome"
              id="sobrenome"
              className="containerInputSobrenome"
              placeholder="Sobrenome"
              value={userCuidador.sobrenome}
              onChange={(e) =>
                setUserCuidador({ ...userCuidador, sobrenome: e.target.value })
              }
            />
          </div>
          <div id="contInputStretch">
            {/* <AlternateEmailIcon id="iconInputLabel" /> */}
            <input
              label="Email"
              id="email"
              type="email"
              className="containerInputEmail"
              placeholder="Email"
              value={userCuidador.email}
              onChange={(e) =>
                setUserCuidador({ ...userCuidador, email: e.target.value })
              }
            />
          </div>
          <div id="contInputsPet">
            {/* <LockIcon id="iconInputLabel" /> */}
            <input
              id="senha"
              type="password"
              onKeyUp={validarSenhaForca}
              className="containerInput"
              placeholder="Senha"
              value={userCuidador.senha}
              onChange={(e) =>
                setUserCuidador({ ...userCuidador, senha: e.target.value })
              }
            />

            {/* <LockOpenIcon id="iconInputLabel" /> */}
            <input
              label="Confirmar Senha"
              id="confirmarSenha"
              type="password"
              className="containerInputConfirmarSenha"
              placeholder="Confirmar Senha"
            />
            <div id="contInputsScroll">
              <input
                type="date"
                id="dataNascimento"
                value={userCuidador.dataNascimento}
                className="inputCalendar"
                onChange={(e) =>
                  setUserCuidador({
                    ...userCuidador,
                    dataNascimento: e.target.value,
                  })
                }
              />
              <select
                value={userCuidador.idSexoHost}
                id="InputsContainerSelect"
                onChange={(e) =>
                  setUserCuidador({
                    ...userCuidador,
                    idSexoHost: e.target.value,
                  })
                }
              >
                <option value={userCuidador.idMasculino}>Masculino</option>
                <option value={userCuidador.idFemininio}>Femininio</option>
              </select>
              {/* <AssignmentIndIcon id="iconInputLabel" /> */}
              <input
                label="CPF"
                id="cpf"
                className="containerInputs"
                placeholder="CPF"
                value={userCuidador.cpf}
                onChange={(e) =>
                  setUserCuidador({ ...userCuidador, cpf: e.target.value })
                }
              />
            </div>
            <div id="contInputsCheckboxScroll">
              <div id="contInputCheckbox">
                <input
                  type="number"
                  value={userCuidador.possuiAnimais}
                  onChange={(e) =>
                    setUserCuidador({
                      ...userCuidador,
                      possuiAnimais: e.target.value,
                    })
                  }
                />
                {/* <span className="checkmarkCuidador"></span> */}
              </div>
              <div id="contInputCheckbox">
                <input
                  type="number"
                  value={userCuidador.possuiCriancas}
                  onChange={(e) => {
                    setUserCuidador({
                      ...userCuidador,
                      possuiCriancas: e.target.value,
                    });
                  }}
                />
              </div>
            </div>
            <div id="contInputsPetScroll">
              {/* <PanToolIcon id="iconInputLabel" /> */}
              <input
                label="Preferências"
                id="limitacoes"
                className="containerInputLimitacoes"
                placeholder="Você possui limitações?"
                value={userCuidador.limitacoes}
                onChange={(e) =>
                  setUserCuidador({
                    ...userCuidador,
                    limitacoes: e.target.value,
                  })
                }
              />
            </div>
            <div id="contInputsMoradia">
              {/* <BusinessIcon id="iconInputLabelLeft" /> */}
              <input
                id="cep"
                className="containerInputMoradia"
                placeholder="Informe seu cep"
                type="number"
              />

              {/* <HouseIcon id="iconInputLabelLeft" /> */}
              <input
                label="Moradia"
                id="moradia"
                className="containerInputMoradia"
                placeholder="Aonde você reside?"
                value={userCuidador.moradia}
                onChange={(e) =>
                  setUserCuidador({
                    ...userCuidador,
                    moradia: e.target.value,
                  })
                }
              />
              <div>
                <div className="containerPreferences">
                  {/* <AccessibilityIcon id="iconInputLabel" /> */}
                  <input
                    label="Preferências"
                    id="preferencias"
                    placeholder="Possui alguma preferência?"
                    className="containerInputPreferencias"
                    value={userCuidador.preferencias}
                    onChange={(e) =>
                      setUserCuidador({
                        ...userCuidador,
                        preferencias: e.target.value,
                      })
                    }
                  />
                  <div className="containerInputBiografia">
                    {/* <InfoIcon id="iconInputLabel"/> */}
                    <input
                      id="biografia"
                      placeholder="Me diga um pouco sobre você"
                      className="inputBiografia"
                      value={userCuidador.biografia}
                      onChange={(e) =>
                        setUserCuidador({
                          ...userCuidador,
                          biografia: e.target.value,
                        })
                      }
                    />
                    <input
                      id="avaliacao"
                      placeholder="Me diga um pouco sobre você"
                      className="inputBiografia"
                      value={userCuidador.avaliacao}
                      onChange={(e) =>
                        setUserCuidador({
                          ...userCuidador,
                          avaliacao: e.target.value,
                        })
                      }
                    />
                  </div>
                </div>
                <div id="containerButton">
                  <input
                    value="Cadastrar"
                    type="submit"
                    id="buttonCadastrar"
                    className="button"
                  />
                </div>
              </div>
            </div>
          </div>
          <div id="impSenha"></div>
          <div id="impForcaSenha"></div>
          <div id="erroSenhaForca"></div>
          <div id="contInputsPet"></div>
        </div>
      </form>
    </>
  );
};

export default InputsIcon;
